(180, 22, 1, '11.5', '0', 'Providing & Supply of Clamp Saddle (DI Strap Saddle) for House Service connections from metal pipe Water Distribution mains shall be of fastened strap type with threaded outlet for service connection. Clamp Saddle shall be suitable for nominal size of distribution mains pipe line. The strap shall be elastomer coated (insulated) type for firm grip on pipe as well as to protect the coating on the pipe and to insulate the unidentical metals. The saddle shall be single strap type upto pipe sizes of NB 600 and service outlet 15mm, 20mm & 25mm. Fasteners shall be of threaded nut-bolt- washer type. The sealing between the saddle and mains shall be obtained by using a profiled elastomer seal matching to the curvature of the pipe. The seal shall be of elastomer type, suitable for all potable water application. The material of construction of the body, straps, fasteners etc, shall be of non corrosive material such as engineering plastic (PE/PP) or stainless steel or a combination of both.', 0, '1', 0, 0, '', '.', 1, '2015-06-03 18:30:00', 0, '2015-06-04 07:03:57'),
